import { Injectable } from '@angular/core';
import { Aukcija } from '../models/Aukcija';
import { HttpClient } from '@angular/common/http';
import { Umetnine } from '../models/Umetnine';

@Injectable({
  providedIn: 'root'
})
export class AukcijeService {

  constructor(private http:HttpClient) { }

  getAllAukcije(){
    return this.http.get<Aukcija[]>("http://localhost:8080/aukcije/getAllAukcije");
  }

  getAllUmetnine(a: Aukcija) {
    return this.http.post<Umetnine[]>("http://localhost:8080/aukcije/getAllUmetnine", a);
  }
}
